/*  notice */
.notice .inner {
  display: flex;
  justify-content: space-around;
  overflow-x: hidden;
}
.notice h2 {
  margin-top: 100px;
  margin-bottom: 50px;
  font-size: 5rem;
}
.notice h2:after {
  content: '▝';
  color: var(--red);
}
.notice h3 {
  font-size: 1.3rem;
  color: var(--red);
